func (c *current) onstart1(tlb interface{}) (interface{}, error) {
	n := &html.Node{
		Type: html.DocumentNode,
	}
	addChild(n, tlb)
	return n, nil
}

func (p *parser) callonstart1() (interface{}, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onstart1(stack["tlb"])
}

